- information on early detection, risk factors, lifestyle changes and screening tests;
- information on testing and treatment options, including mammography;
- information on finding reliable answers to common breast cancer questions;
- resources for the affected person, family, and loved ones;
- educational resources for individuals with breast cancer, family members and those caring for themselves or their loved ones.
